import React from "react";

function Bounties(props) {
    const { firstName, lastName, isLiving, type, bounty, _id } = props
    return (
        <div>
            <h1>Name: {firstName} {lastName}</h1>
            <h2>Living: {isLiving}</h2>
            <h2>Type: {type}</h2>
            <h2>Price: {bounty}</h2>
            <button>Delete</button>
        </div>
    )

}

export default (Bounties)
